// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.9;

import "hardhat/console.sol";
import "./Token.sol";

contract Exchange {
    address public feeAccount;
    uint256 public feePercent;
    uint256 public ordersCount;

    mapping(address => mapping(address => uint256)) public tokens;
    mapping(uint256 => _Order) public orders;
    mapping (uint256 => bool) public orderCancelled;

    event Deposit(
        address _token, 
        address _user, 
        uint256 _amount, 
        uint256 _balance
    );
    event Withdraw(
        address _token, 
        address _user, 
        uint256 _amount, 
        uint256 _balance
    );
    event Order(
        uint256 _id,
        address _user,
        address _tokenGet,
        uint256 _amountGet,
        address _tokenGive,
        uint256 _amountGive,
        uint256 _timestamp
    );
    event Cancel(
        uint256 _id,
        address _user,
        address _tokenGet,
        uint256 _amountGet,
        address _tokenGive,
        uint256 _amountGive,
        uint256 _timestamp
    );

    struct _Order {
        uint256 id;
        address user;
        address tokenGet;
        uint256 amountGet;
        address tokenGive;
        uint256 amountGive;
        uint256 timestamp;
    }

    constructor(address _feeAccount, uint256 _feePercent) 
    {
        feeAccount = _feeAccount;
        feePercent = _feePercent;
    }

    /////////
    // DEPOSIT AND WITHDRAW
    /////////

    function depositToken(address _token, uint256 _amount)
        public
    {
        require(Token(_token).transferFrom(msg.sender, address(this), _amount), 'Exchange Specific Error');

        tokens[_token][msg.sender] += _amount;

        emit Deposit(_token, msg.sender, _amount, tokens[_token][msg.sender]);
    }

    function withdrawToken(address _token, uint256 _amount)
        public
    {
        require(_amount <= tokens[_token][msg.sender], 'User does not have enough Tokens');
        require(Token(_token).transfer(msg.sender, _amount), 'Exchange Specific Error');
        
        tokens[_token][msg.sender] -= _amount;
        
        emit Withdraw(_token, msg.sender, _amount, tokens[_token][msg.sender]);
    }

    function balanceOf(address _token, address _user)
        public
        view
        returns (uint256)
    {
        return tokens[_token][_user];
    }

    /////////
    // ORDERS
    /////////

    function makeOrder(address _tokenGet, uint256 _amountGet, address _tokenGive, uint256 _amountGive)
        public
    {
        require(balanceOf(_tokenGive, msg.sender) >= _amountGive, 'Not enough Tokens');

        ordersCount += 1;

        orders[ordersCount] = _Order(
            ordersCount, 
            msg.sender, 
            _tokenGet, 
            _amountGet, 
            _tokenGive, 
            _amountGive, 
            block.timestamp
        );

        emit Order(
            ordersCount, 
            msg.sender, 
            _tokenGet, 
            _amountGet, 
            _tokenGive, 
            _amountGive, 
            block.timestamp
        );
    }

    function cancelOrder(uint256 _id)
        public
    {
        _Order storage _order = orders[_id];

        require(address(_order.user) == msg.sender, 'cant cancel other user order');

        require(_order.id == _id, 'order must be existing');

        orderCancelled[_id] = true;

        emit Cancel(
            _order.id,
            msg.sender,
            _order.tokenGet,
            _order.amountGet,
            _order.tokenGive,
            _order.amountGive,
            block.timestamp
        );
    }

}

contracts/Token.sol.content:
// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.9;

import "hardhat/console.sol";

contract Token {
    string public name;
    string public symbol;
    uint256 public totalSupply;
    uint256 public decimals = 18;

    mapping(address => uint256) public balanceOf;
    mapping(address => mapping(address => uint256)) public allowance;

    event Transfer(
        address indexed _from, 
        address indexed _to, 
        uint256 _value
    );
    event Approval(
        address indexed _owner,
        address indexed _spender,
        uint256 _value
    );

    constructor(
        string memory _name,
        string memory _symbol,
        uint256 _totalSupply
    ) {
        name = _name;
        symbol = _symbol;
        totalSupply = _totalSupply * (10**decimals);
        balanceOf[msg.sender] = totalSupply;
    }

    function transfer(address _to, uint256 _value) 
        public 
        returns (bool success) 
    {
        require(_value <= balanceOf[msg.sender], 'ERC-20: Not enough tokens!');

        _transfer(msg.sender, _to, _value);

        return true;
    }

    function _transfer(address _from, address _to, uint256 _value)
        internal
    {
        require(_to != address(0));

        balanceOf[_from] -= _value;
        balanceOf[_to] += _value;

        emit Transfer(_from, _to, _value);
    }

    function approve(address _spender, uint256 _value) 
        public 
        returns (bool success) 
    {
        require(_spender != address(0));

        allowance[msg.sender][_spender] = _value;
        
        emit Approval(msg.sender, _spender, _value);

        return true;
    }

    function transferFrom(address _from, address _to, uint256 _value) 
        public
        returns (bool success) 
    {
        require(_value <= balanceOf[_from], 'ERC-20: Not enough tokens!');
        require(_value <= allowance[_from][msg.sender], 'ERC-20: Not enough tokens!');

        _transfer(_from, _to, _value);

        allowance[_from][msg.sender] -= _value;

        return true;
    }

}

